import React from "react"; // Importing React from react is a must. useState is an aditional one I have imported from react to managestates.
import "./App.css"; // The CSS file of App.js
import NavigationBar from "./SimpleComponents/NavBar";
import NameList from "./NameList";

function App() {
  return (
    <React.Fragment>
      <NavigationBar />
      <NameList />
    </React.Fragment>
  );
}
export default App;
